import { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { useAuth } from "../context/AuthContext";

const ORGANIZATION_TYPES = [
  "非营利组织",
  "企业",
  "政府机构",
  "教育机构",
  "社区组织",
  "初创公司",
  "其他",
];

export default function ProfileDetailsPage() {
  const navigate = useNavigate();
  const { user } = useAuth();
  const [error, setError] = useState("");
  const [formData, setFormData] = useState({
    location: "",
    organizationType: "",
    partnershipDescription: "",
  });

  const handleSubmit = async (e) => {
    e.preventDefault();
    console.log("开始提交表单数据...");

    try {
      // 准备发送的数据
      const dataToSend = {
        location: formData.location,
        organizationType: formData.organizationType,
        partnershipDescription: formData.partnershipDescription,
      };

      console.log("准备发送的数据:", dataToSend);

      const token = localStorage.getItem("token");
      console.log("使用的token:", token);

      const response = await fetch("http://localhost:3001/api/profile", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${token}`,
        },
        body: JSON.stringify(dataToSend),
      });

      const data = await response.json();
      console.log("服务器响应:", data);

      if (!response.ok) {
        throw new Error(`Server error: ${JSON.stringify(data)}`);
      }

      if (data.code === 0) {
        console.log("个人资料保存成功");
        // 更新 AuthContext 中的用户信息
        if (user) {
          user.profileComplete = true;
        }
        // 跳转到用户主页
        navigate("/home");
      } else {
        throw new Error(data.message || "Unknown error");
      }
    } catch (error) {
      console.error("错误详情:", error);
      setError(error.message || "保存个人资料时出错");
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleBack = () => {
    navigate(-1);
  };

  return (
    <div
      className="min-h-screen bg-cover bg-center"
      style={{ backgroundImage: "url('/images/green-hills.jpg')" }}
    >
      <div className="absolute top-4 left-4">
        <button
          onClick={handleBack}
          className="flex items-center text-white hover:text-gray-200"
        >
          <svg
            xmlns="http://www.w3.org/2000/svg"
            className="h-6 w-6 mr-1"
            fill="none"
            viewBox="0 0 24 24"
            stroke="currentColor"
          >
            <path
              strokeLinecap="round"
              strokeLinejoin="round"
              strokeWidth={2}
              d="M10 19l-7-7m0 0l7-7m-7 7h18"
            />
          </svg>
          Back
        </button>
      </div>

      <div className="flex flex-col items-center justify-center min-h-screen px-4 py-12">
        <div className="w-full max-w-3xl bg-black bg-opacity-40 backdrop-blur-sm rounded-lg p-8 shadow-xl">
          <h1 className="text-4xl font-bold text-white text-center mb-12">
            Let's Find Your Perfect Partner
          </h1>

          {error && (
            <div className="mb-4 text-red-400 bg-red-100 bg-opacity-20 p-3 rounded">
              {error}
            </div>
          )}

          <form onSubmit={handleSubmit} className="space-y-8">
            <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
              <div>
                <label
                  htmlFor="location"
                  className="block text-white text-lg font-medium mb-2"
                >
                  Location
                </label>
                <input
                  type="text"
                  id="location"
                  name="location"
                  placeholder="Enter location"
                  className="w-full bg-white bg-opacity-20 text-white placeholder-gray-300 border border-gray-300 rounded-md py-3 px-4 focus:outline-none focus:ring-2 focus:ring-teal-500"
                  value={formData.location}
                  onChange={handleChange}
                />
              </div>

              <div>
                <label
                  htmlFor="organizationType"
                  className="block text-white text-lg font-medium mb-2"
                >
                  Organization Type
                </label>
                <select
                  id="organizationType"
                  name="organizationType"
                  className="w-full bg-white bg-opacity-20 text-white border border-gray-300 rounded-md py-3 px-4 focus:outline-none focus:ring-2 focus:ring-teal-500"
                  value={formData.organizationType}
                  onChange={handleChange}
                >
                  <option value="" disabled>
                    Select type
                  </option>
                  {ORGANIZATION_TYPES.map((type) => (
                    <option key={type} value={type} className="text-gray-800">
                      {type}
                    </option>
                  ))}
                </select>
              </div>
            </div>

            <div>
              <label
                htmlFor="partnershipDescription"
                className="block text-white text-lg font-medium mb-2"
              >
                What Kind of Organization Are You Looking For?
              </label>
              <textarea
                id="partnershipDescription"
                name="partnershipDescription"
                rows={5}
                placeholder="Describe your ideal partnership..."
                className="w-full bg-white bg-opacity-20 text-white placeholder-gray-300 border border-gray-300 rounded-md py-3 px-4 focus:outline-none focus:ring-2 focus:ring-teal-500"
                value={formData.partnershipDescription}
                onChange={handleChange}
              />
            </div>

            <div className="flex justify-center pt-4">
              <button
                type="submit"
                className="bg-teal-500 hover:bg-teal-600 text-white font-bold py-3 px-8 rounded-md text-lg transition duration-300"
              >
                Find Partners
              </button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
}
